webpackJsonp([0xd66655073bc1],{488:function(n,t){n.exports={data:{markdownRemark:{html:'<p>目前我校的VPN账号已经与校园网上网账号合并，即使用您的上网账号即可登陆VPN。换句话说，就是用您的教工号作为用户名（不需要再加@vpn的后缀了），用您的上网密码作为密码即可。</p>\n<p>另外，目前我们学校的VPN只提供给在职教职工，以及在读博士使用，其他同学是不能申请VPN账号的 :(</p>\n<p>VPN的使用方法，请点击<a href="http://www.itc.ynu.edu.cn/info/1056/1069.htm">VPN使用指导书</a></p>\n<p>关于云南大学的VPN服务如果您还有其他问题，请拨打信息技术中心运维服务部电话咨询，号码：0871-65031141，假期也有人值班的哦</p>\n<h2>tip</h2>\n<ul>\n<li>如果您使用的是windows10，那么请下载客户端</li>\n</ul>\n<p>附件：</p>\n<ol>\n<li><a href="http://www.itc.ynu.edu.cn/system/_content/download.jsp?urltype=news.DownloadAttachUrl&#x26;owner=1355056356&#x26;wbfileid=2127212">云南大学VPN客户端</a></li>\n<li><a href="http://www.itc.ynu.edu.cn/system/_content/download.jsp?urltype=news.DownloadAttachUrl&#x26;owner=1355056356&#x26;wbfileid=1730364">外聘_返聘人员校园网服务申报表</a></li>\n<li><a href="http://www.itc.ynu.edu.cn/system/_content/download.jsp?urltype=news.DownloadAttachUrl&#x26;owner=1355056356&#x26;wbfileid=1730363">云南大学教职工vpn服务申报表(批量)</a></li>\n<li><a href="http://www.itc.ynu.edu.cn/system/_content/download.jsp?urltype=news.DownloadAttachUrl&#x26;owner=1355056356&#x26;wbfileid=1730362">云南大学vpn服务个人申请表</a></li>\n</ol>',fields:{slug:"yun-nan-da-xue-vpnshi-yong-zhi-dao.html"},frontmatter:{title:"云南大学VPN使用指导",date:"December 6th 2017",tags:["VPN","使用指导"]}}},pathContext:{slug:"yun-nan-da-xue-vpnshi-yong-zhi-dao.html",prev:{fields:{slug:"yun-nan-da-xue-xin-xi-ji-zhu-zhong-xin-de-wei-zhi-jing-bin-lou.html"},frontmatter:{title:"云南大学信息技术中心的位置（敬宾楼）",date:"2017-12-06T10:16:10.000Z",tags:["敬宾楼","信息技术中心"]}},next:{fields:{slug:"yun-nan-da-xue-itzi-yuan-shen-qing-biao.html"},frontmatter:{title:"云南大学IT资源申请表",date:"2017-12-06T10:16:10.000Z",tags:["申请流程"]}}}}}});
